import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Onboarding() {
  const navigate = useNavigate();
  const [step, setStep] = useState(1);
  const [selectedOption, setSelectedOption] = useState('');

  const handleSubmit = () => {
    if (selectedOption === 'job') navigate('/recommended-jobs');
    else if (selectedOption === 'interview') navigate('/ai-interview-practice');
    else if (selectedOption === 'resume') navigate('/ai-resume');
    else alert('Please select an option to proceed.');
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-white px-6 py-12">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-center text-purple-600">
          Launch<span className="text-gray-900">Hire</span>
        </h1>
      </div>

      {/* Step 1 */}
      {step === 1 && (
        <div className="flex flex-col md:flex-row items-center gap-12 max-w-4xl">
          {/* Text */}
          <div className="text-center md:text-left">
            <h2 className="text-2xl md:text-3xl font-bold mb-4">
              Let’s Land Your First Job Faster with AI
            </h2>
            <p className="text-gray-600 mb-6">
              Smart job matching. AI interviews. Instant resume tailoring.
            </p>
            <button
              onClick={() => setStep(2)}
              className="px-6 py-2 bg-purple-600 text-white rounded hover:bg-purple-700"
            >
              Let’s Go!
            </button>
          </div>

          {/* Image */}
          <div className="w-64 h-64 md:w-[350px] md:h-[350px] overflow-hidden rounded-lg shadow-lg">
            <img
              src={require('../assets/onboarding-image.jpg')}
              alt="Onboarding"
              className="w-full h-full object-cover"
            />
          </div>
        </div>
      )}

      {/* Step 2 */}
      {step === 2 && (
        <div className="w-full max-w-xl text-center">
          <h2 className="text-2xl font-bold mb-2 text-gray-800">
            What’s Your First Step Toward Success?
          </h2>
          <p className="text-gray-500 mb-6">
            Whether you're job hunting, practicing interviews, or polishing your resume we'll guide you every step.
          </p>
          <div className="flex flex-col gap-3 mb-6">
            <label className="flex items-center justify-between px-4 py-3 border rounded cursor-pointer hover:bg-gray-50">
              <input
                type="radio"
                name="step"
                value="job"
                checked={selectedOption === 'job'}
                onChange={() => setSelectedOption('job')}
              />
              <span className="ml-4 text-gray-700">Find My First Job</span>
            </label>
            <label className="flex items-center justify-between px-4 py-3 border rounded cursor-pointer hover:bg-gray-50">
              <input
                type="radio"
                name="step"
                value="interview"
                checked={selectedOption === 'interview'}
                onChange={() => setSelectedOption('interview')}
              />
              <span className="ml-4 text-gray-700">Practice Interviews</span>
            </label>
            <label className="flex items-center justify-between px-4 py-3 border rounded cursor-pointer hover:bg-gray-50">
              <input
                type="radio"
                name="step"
                value="resume"
                checked={selectedOption === 'resume'}
                onChange={() => setSelectedOption('resume')}
              />
              <span className="ml-4 text-gray-700">Build My Resume</span>
            </label>
          </div>

          <div className="flex justify-center gap-4">
            <button
              onClick={() => setStep(1)}
              className="px-6 py-2 bg-gray-200 text-gray-800 rounded hover:bg-gray-300"
            >
              Back
            </button>
            <button
              onClick={handleSubmit}
              className="px-6 py-2 bg-purple-600 text-white rounded hover:bg-purple-700"
            >
              Next
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
